Method.Source:
    [Form]
    public class InventTransArchiveVoucher extends FormRun
    {
        boolean                             physicalVoucher;
        InventDimCtrl_Frm_ActiveRightClick  inventDimFormSetup;
}

void init()
{
    NoYes n = element.args().parmEnum();

    physicalVoucher = n;

    super();

    if (physicalVoucher)
    {
        element.design(1).caption("@SYS55588");
    }
    else
    {
        element.design(1).caption("@SYS55584");
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParm;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init          :
            InventDimSetupGrid::initInventDimParmInventTrans(inventDimParm);

            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_ActiveRightClick::newFromForm(element);
            }
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true);
    }
}

public void init()
{
    super();

    inventTrans_ds.cacheAddMethod(tableMethodStr(InventTransArchive, isNonFinancialTransfer));
    inventTrans_ds.cacheAddMethod(tableMethodStr(InventTransArchive, transferInventTransId));
}

void init()
{
    Query                   query;
    QueryBuildDataSource    qbs;
    QueryBuildDataSource    qbsTrans;
    QueryBuildDataSource    qbsDim;
    QueryBuildDataSource    qbsTransOrigin;

    super();

    if (element.args().dataset() == tableNum(InventTransArchive))
    {
        query = new Query();
        qbs   = query.addDataSource(tableNum(InventTransPosting));
        qbs.name(inventTransPosting_ds.name());

        if (!physicalVoucher)
        {
            qbs.addDynalink(fieldNum(InventTransPosting,TransDate),element.args().record(), fieldNum(InventTransArchive,DateFinancial));
            qbs.addDynalink(fieldNum(InventTransPosting,Voucher),element.args().record(), fieldNum(InventTransArchive,Voucher));
            qbs.addRange(fieldNum(InventTransPosting,InventTransPostingType)).value(queryValue(InventTransPostingType::Financial));

            qbsTrans = qbs.addDataSource(tableNum(InventTransArchive));
            qbsTrans.name(inventTrans_ds.name());
            qbsTrans.joinMode(JoinMode::OuterJoin);

            qbsTrans.addDynalink(fieldNum(InventTransArchive,DateFinancial),inventTransPosting, fieldNum(InventTransPosting,TransDate));
            qbsTrans.addDynalink(fieldNum(InventTransArchive,Voucher),inventTransPosting, fieldNum(InventTransPosting,Voucher));
            qbsTrans.addDynalink(fieldNum(InventTransArchive,InventTransOrigin),inventTransPosting, fieldNum(InventTransPosting,InventTransOrigin));
        }
        else
        {
            qbs.addDynalink(fieldNum(InventTransPosting,TransDate),element.args().record(), fieldNum(InventTransArchive,DatePhysical));
            qbs.addDynalink(fieldNum(InventTransPosting,Voucher),element.args().record(), fieldNum(InventTransArchive,VoucherPhysical));
            qbs.addRange(fieldNum(InventTransPosting,InventTransPostingType)).value(queryValue(InventTransPostingType::Physical));

            qbsTrans = qbs.addDataSource(tableNum(InventTransArchive));
            qbsTrans.name(inventTrans_ds.name());
            qbsTrans.joinMode(JoinMode::OuterJoin);

            qbsTrans.addDynalink(fieldNum(InventTransArchive,DatePhysical),inventTransPosting, fieldNum(InventTransPosting,TransDate));
            qbsTrans.addDynalink(fieldNum(InventTransArchive,VoucherPhysical),inventTransPosting, fieldNum(InventTransPosting,Voucher));
            qbsTrans.addDynalink(fieldNum(InventTransArchive,InventTransOrigin),inventTransPosting, fieldNum(InventTransPosting,InventTransOrigin));
        }

        qbsDim = qbsTrans.addDataSource(tableNum(InventDim));
        qbsDim.name(inventDim_ds.name());
        qbsDim.joinMode(JoinMode::InnerJoin);
        qbsDim.addLink(fieldNum(InventTransArchive,InventDimId),fieldNum(InventDim,InventDimId));

        qbsTransOrigin = qbsTrans.addDataSource(tableNum(InventTransOrigin));
        qbsTransOrigin.name(inventTransOrigin_ds.name());
        qbsTransOrigin.joinMode(JoinMode::InnerJoin);
        qbsTransOrigin.addLink(fieldNum(InventTransArchive,InventTransOrigin),fieldNum(InventTransOrigin,RecId));

        this.query(query);
    }
}

int active()
{
    int ret;

    ret = super();
    inventTrans_ds.active();
    inventDim_DS.active();
    inventTransOrigin_ds.active();

    return ret;
}
